import styled from 'styled-components';

export const HomeWidget=styled.div`
    margin:20px 10%;
    overflow:hidden;
`
export const HomeLeftWidget=styled.div`
    width:66%;
    margin:0 2%;
    float:left;
    .HomeImg{
        display:block;
        width:100%;
        height:280px;
        margin:0;
        box-shadow:2px 2px 8px #333333;
    }
`
export const HomeRightWidget=styled.div`
    width:30%;
    float:right;

`
